exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,cleanNewest}=await require("transcode/parse_catalog"),url=`http://www.ymoxuan.org/book/${bid.idPrefix()}/${bid}/index.html`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/class="mulu"[^>]*>/,"</ul>"),recordRegex:/volumn">(?<volume>[^<]+)<|href="(?<url>[^"]+)">(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions)}}).then(cleanNewest)};